import{_ as t,c as r,o as e,U as a}from"./chunks/framework.9_Yh8MfL.js";const o="/blog/assets/91529822720e0cf3d7caf9c8af0ce51fbe096b637ce7.ekILPVVt.jpeg",w=JSON.parse('{"title":"🗺️上海","description":"","frontmatter":{},"headers":[],"relativePath":"life/travel/Shanghai.md","filePath":"life/travel/Shanghai.md"}'),n={name:"life/travel/Shanghai.md"},p=a('<h1 id="🗺️上海" tabindex="-1"><strong>🗺️上海</strong> <a class="header-anchor" href="#🗺️上海" aria-label="Permalink to &quot;**🗺️上海**&quot;">​</a></h1><p>🕰️ <strong>2024-2-12 —— 2024-2-16</strong></p><p>🌞 <strong>5天</strong></p><h2 id="旅行用品" tabindex="-1">旅行用品 <a class="header-anchor" href="#旅行用品" aria-label="Permalink to &quot;旅行用品&quot;">​</a></h2><ul><li><p>一次性浴巾、毛巾</p></li><li><p>电动牙刷+牙膏</p></li><li><p>电动剃须刀</p></li><li><p>雨伞</p></li><li><p>身份证</p></li><li><p>口罩</p></li><li><p>布洛芬与感冒药</p></li><li><p>暖贴</p></li></ul><h2 id="花费" tabindex="-1">花费 <a class="header-anchor" href="#花费" aria-label="Permalink to &quot;花费&quot;">​</a></h2><table><thead><tr><th>名称</th><th>金额</th></tr></thead><tbody><tr><td>机场打车到酒店</td><td>40</td></tr><tr><td>东泰祥生煎</td><td>53</td></tr><tr><td>打车到晶焱上海菜</td><td>30.4</td></tr><tr><td>晶焱上海菜</td><td>212</td></tr><tr><td>寄存柜</td><td>52</td></tr><tr><td>打车到苏州博物馆</td><td>22.07</td></tr><tr><td>听雨轩苏州菜</td><td>168</td></tr><tr><td>草莓</td><td>15</td></tr><tr><td>BC黄油面包</td><td>82</td></tr><tr><td>豆浆鸡蛋</td><td>16.5</td></tr><tr><td>苏州回来打车到酒店</td><td>74.24</td></tr><tr><td>迪士尼优先通道</td><td>720</td></tr><tr><td>山石榴</td><td>364</td></tr><tr><td>朵云书店饮品</td><td>93</td></tr><tr><td>宾馆购物机</td><td>11.44</td></tr><tr><td>迪士尼附近宾馆</td><td>376</td></tr><tr><td>沪上阿姨</td><td>29.5</td></tr><tr><td>打车到苏州中心广场</td><td>19.52</td></tr><tr><td>上海酒店</td><td>576</td></tr><tr><td>耦园门票</td><td>20</td></tr><tr><td>北京地铁购物机</td><td>16</td></tr><tr><td>机票</td><td>2238</td></tr><tr><td>迪士尼小象超市</td><td>95.98</td></tr></tbody></table><h2 id="day1" tabindex="-1">day1 <a class="header-anchor" href="#day1" aria-label="Permalink to &quot;day1&quot;">​</a></h2><p>✈️ 大兴-虹桥 21:55 —— 23:55</p><p>🏨 酒店 14日退房</p><h2 id="day2" tabindex="-1">day2 <a class="header-anchor" href="#day2" aria-label="Permalink to &quot;day2&quot;">​</a></h2><p>🏞️ <strong><a href="https://www.mafengwo.cn/poi/23338.html" target="_blank" rel="noreferrer">武康路文化街</a></strong></p><img src="https://p1-q.mafengwo.net/s14/M00/8D/43/wKgE2l1MAsWADgY6AGaXsDMak5E07.jpeg?imageMogr2%2Fthumbnail%2F%21305x183r%2Fgravity%2FCenter%2Fcrop%2F%21305x183%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><p>🏞️ <strong>三千vintage</strong></p><img src="https://p1-q.mafengwo.net/s18/M00/BA/42/CoUBYGC7jOqAWXkZABrOj6o_w9Y03.jpeg?imageMogr2%2Fthumbnail%2F%21690x370r%2Fgravity%2FCenter%2Fcrop%2F%21690x370%2Fquality%2F90%7Cwatermark%2F1%2Fimage%2FaHR0cDovL21mdy1mYXN0ZGZzLTEyNTgyOTUzNjUuY29zLmFwLWJlaWppbmcubXlxY2xvdWQuY29tL3MxMS9NMDAvNDQvOUIvd0tnQkVGc1A1UnlBRHY3cEFBQUhaWlVQUmxROTkwLnBuZw%3D%3D%2Fgravity%2FSouthEast%2Fdx%2F10%2Fdy%2F11" style="width:250px;height:150px;object-fit:cover;"><blockquote><p>店里陈列着店主多年收集的、以宝可梦为主的二次元手办周边，仔细观察能收获不少意外惊喜。</p></blockquote><p>🏙️ <strong>朵云书店 （￥35）</strong></p><img src="https://wutopialab.oss-cn-shanghai.aliyuncs.com/news/20190812173107.jpg" style="width:250px;height:150px;object-fit:cover;"><blockquote><p>咖啡、上海全景 🔔 需公众号预约 (未来6日 2月8日预约 每日7:00)</p></blockquote><p>⛪ <strong><a href="https://www.mafengwo.cn/poi/3889729.html" target="_blank" rel="noreferrer">豫园</a>（￥30）</strong></p><img src="https://p1-q.mafengwo.net/s11/M00/37/5A/wKgBEFxMTcyAUmyMAFq8McgO-B857.jpeg?imageMogr2%2Fthumbnail%2F%21690x370r%2Fgravity%2FCenter%2Fcrop%2F%21690x370%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><p>⛪ <strong><a href="https://www.mafengwo.cn/poi/4464.html" target="_blank" rel="noreferrer">城隍庙</a></strong></p><img src="https://p1-q.mafengwo.net/s12/M00/74/57/wKgED1wAjVWAIaVQAAVeykoNMAg34.jpeg?imageMogr2%2Fthumbnail%2F%21380x270r%2Fgravity%2FCenter%2Fcrop%2F%21380x270%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><p>🌆 <strong><a href="https://www.mafengwo.cn/poi/5504076.html" target="_blank" rel="noreferrer">外滩</a></strong></p><img src="https://p1-q.mafengwo.net/s6/M00/B2/18/wKgB4lJ1MdWABIHAAAysp_8i80o98.jpeg?imageMogr2%2Fthumbnail%2F%21380x270r%2Fgravity%2FCenter%2Fcrop%2F%21380x270%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><p>（根据实际情况调整）</p><h2 id="day3" tabindex="-1">day3 <a class="header-anchor" href="#day3" aria-label="Permalink to &quot;day3&quot;">​</a></h2><p><strong>🚄 上海-苏州园区 08:25 - 08:49</strong></p><p><strong>经典路线</strong></p><img src="https://p1-q.mafengwo.net/s11/M00/36/04/wKgBEFp5JU2AS_CaAAnVT5AXsl466.jpeg?imageView2%2F2%2Fw%2F1360%2Fq%2F90" style="width:650px;"><blockquote><p>如果你第一次来苏州，那么这是一条非常推荐的步行路线。参观完拙政园片儿区，就上<strong>平江路</strong>，一直向南走到<strong>干将东路</strong>，别忘了把主路旁的小巷也逛一逛，特别是中张家巷和大柳枝巷；之后继续向南走到<strong>凤凰街</strong>，经<strong>十梓街</strong>到苏州大学，然后由<strong>十全街</strong>到网师园，继续向西南方向行走，途径沧浪亭，最后走上<strong>新市路</strong>，到达盘门。</p></blockquote><img src="https://p1-q.mafengwo.net/s11/M00/35/AB/wKgBEFp5JRuAMcmuABZXl3hyrQ433.jpeg?imageView2%2F2%2Fw%2F1360%2Fq%2F90" style="width:650px;"><p><strong>苏州美食主要集中在观前街、平江路、山塘街、十全街一带。</strong></p><img src="https://p1-q.mafengwo.net/s11/M00/36/B4/wKgBEFp5JbKAOfA4AChmp8n554g36.jpeg?imageView2%2F2%2Fw%2F1360%2Fq%2F90" style="width:650px;"><p>🏛️ <strong><a href="https://www.mafengwo.cn/poi/5674.html" target="_blank" rel="noreferrer">苏州博物馆</a></strong></p><img src="https://p1-q.mafengwo.net/s11/M00/E2/05/wKgBEFtmukmAY8XmAAlqenQsWsY51.jpeg?imageMogr2%2Fthumbnail%2F%21380x270r%2Fgravity%2FCenter%2Fcrop%2F%21380x270%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><blockquote><p>🔔 需公众号预约 (未来7日 2月8日预约 每日0点)</p></blockquote><p>🏞️ <strong><a href="https://www.mafengwo.cn/poi/642.html" target="_blank" rel="noreferrer">拙政园</a></strong>（￥70）</p><p>🏞️ <strong><a href="https://www.mafengwo.cn/poi/642.html" target="_blank" rel="noreferrer">平江路</a></strong></p><p>🏞️ <strong><a href="https://www.mafengwo.cn/poi/642.html" target="_blank" rel="noreferrer">沧浪亭</a></strong>（￥15）</p><blockquote><p>苏州“小”园林，首推<strong>沧浪亭</strong>，园中只有寥寥游人与画匠，可尽情欣赏108式花窗与“清风明月本无价，近水远山皆有情”的田园意趣；隐匿在巷子深处<strong>艺圃</strong>堪称苏州园林最高性价比，素雅朴实的画风透露着恬淡之美；<strong>环秀山庄</strong>小巧玲珑，还有精美的苏绣可以欣赏；你还可以去<strong>耦园</strong>寻“佳偶”，看清代恩爱夫妻相伴终老之所。</p><p>虽不是世界遗产，<strong>怡园</strong>里的假山还能随意攀爬，<strong>朴园</strong>清净无人打扰，<strong>五峰园</strong>可像当地人一样喝茶话家常……这些园子清幽，门票也不贵，有的还免费，静静的坐上半日，不管是冥思还是品茶，都能让人体会苏州园林中无处不在的微妙之趣。</p></blockquote><p>🏞️ <strong><a href="https://www.mafengwo.cn/poi/642.html" target="_blank" rel="noreferrer">虎丘山风景名胜区</a></strong></p><blockquote><p>新春特惠 每人30￥ 大众点评已购买</p></blockquote><p>🏞️ <strong><a href="https://www.mafengwo.cn/poi/642.html" target="_blank" rel="noreferrer">山塘街</a></strong></p><p>🏞️ <strong><a href="https://www.mafengwo.cn/poi/642.html" target="_blank" rel="noreferrer">金鸡湖景区</a></strong></p><img src="https://p1-q.mafengwo.net/s12/M00/88/6B/wKgED1wYXSmAd0JDAB0_yM3Mb3c54.jpeg?imageMogr2%2Fthumbnail%2F%21305x183r%2Fgravity%2FCenter%2Fcrop%2F%21305x183%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><blockquote><p>19:30 20:30 两场音乐喷泉</p></blockquote><p><strong>🚄 苏州-上海 21:25 - 21:59</strong></p><p><strong>🏨 酒店 (16日退房 车程大概一小时)</strong></p><h2 id="day4" tabindex="-1">day4 <a class="header-anchor" href="#day4" aria-label="Permalink to &quot;day4&quot;">​</a></h2><p>🎠 <strong><a href="https://www.mafengwo.cn/poi/6102028.html" target="_blank" rel="noreferrer">迪士尼</a></strong></p><img src="https://p1-q.mafengwo.net/s11/M00/54/C2/wKgBEFtRWgOAL6CtAAhBG3gnnaM20.jpeg?imageMogr2%2Fthumbnail%2F%21690x370r%2Fgravity%2FCenter%2Fcrop%2F%21690x370%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><blockquote><p>生日当月前来上海迪士尼乐园，凭本人有效身份证件前往游客服务中心，有机会免费领取生日徽章一枚。每位游客每次只可领取一枚生日徽章，徽章每日发放数量有限，先到先得，领完即止。</p></blockquote><h2 id="day5" tabindex="-1">day5 <a class="header-anchor" href="#day5" aria-label="Permalink to &quot;day5&quot;">​</a></h2><p>⛪ <a href="https://www.mafengwo.cn/poi/1364.html" target="_blank" rel="noreferrer">田子坊</a></p><img src="https://p1-q.mafengwo.net/s10/M00/AF/B1/wKgBZ1uA7l6AIjoSAAfkEFSJ3lQ91.jpeg?imageMogr2%2Fthumbnail%2F%21380x270r%2Fgravity%2FCenter%2Fcrop%2F%21380x270%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><p>⛪ <a href="https://www.mafengwo.cn/poi/4527.html" target="_blank" rel="noreferrer">思南公馆</a></p><img src="https://p1-q.mafengwo.net/s12/M00/6A/C0/wKgED1wlZPmAFHJyACGD7cq8T2s95.jpeg?imageMogr2%2Fthumbnail%2F%21690x370r%2Fgravity%2FCenter%2Fcrop%2F%21690x370%2Fquality%2F100" style="width:250px;height:150px;object-fit:cover;"><p>✈️ 虹桥-北京首都 19:00 —— 21:20</p><h2 id="美食" tabindex="-1">美食 <a class="header-anchor" href="#美食" aria-label="Permalink to &quot;美食&quot;">​</a></h2><p><strong>生煎</strong></p><img src="https://p1-q.mafengwo.net/s11/M00/4D/79/wKgBEFrkHimADKq-AAbh-uqSjA012.jpeg?imageMogr2%2Fthumbnail%2F%21480x320r%2Fgravity%2FCenter%2Fcrop%2F%21480x320%2Fquality%2F90" style="width:250px;height:150px;object-fit:cover;"><p>1.大壶春</p><blockquote><p>大壶春的“无汤生煎”是它的一大特色，面皮厚实松软，裹着少少的油水和饱满的馅料</p></blockquote><p>2.东泰祥</p><p><strong>本帮菜</strong></p><img src="'+o+'" style="width:250px;height:150px;object-fit:cover;"><p>1.上海老饭店</p><p>2.上海德兴馆</p><h2 id="相关资料" tabindex="-1">相关资料 <a class="header-anchor" href="#相关资料" aria-label="Permalink to &quot;相关资料&quot;">​</a></h2><p><a href="https://imfw.cn/l/315876279" target="_blank" rel="noreferrer">繁花圣地巡礼</a></p><p><a href="https://www.xiaoyuzhoufm.com/episode/60d81eb925da4f997b8ba25e" target="_blank" rel="noreferrer">电台：如果你来上海，我想带你去这些地方</a></p><p><a href="https://www.mafengwo.cn/gonglve/ziyouxing/98398.html" target="_blank" rel="noreferrer">苏州十大看点，让你遇到雅致江南 - 马蜂窝</a></p>',73),g=[p];function i(s,l,h,d,c,m){return e(),r("div",null,g)}const f=t(n,[["render",i]]);export{w as __pageData,f as default};
